/* ACTION TYPE CONSTANTS

You can use any convention you wish here, but the name should remain UPPER_SNAKE_CASE for consistency.

*/

const ADD_TEST = "app_main/test/ADD_TEST";
const REMOVE_TEST = "app_main/test/REMOVE_TEST";

const UPDATE_READING_ANSWER = "app_main/test/UPDATE_READING_ANSWER";
const REMOVE_ANSWER_SHEET = "app_main/test/REMOVE_ANSWER_SHEET";

export default {
  ADD_TEST,
  REMOVE_TEST,
  UPDATE_READING_ANSWER,
  REMOVE_ANSWER_SHEET,
};
